return ['domain'=>NULL,'plural-forms'=>'nplurals=4; plural=(n%100==1 ? 0 : n%100==2 ? 1 : n%100>=3 && n%100<=4 ? 2 : 3);','language'=>'sl','pot-creation-date'=>'2025-09-04 09:59-0500','po-revision-date'=>'2025-09-04 09:59-0500','translation-revision-date'=>'2025-09-04 09:59-0500','project-id-version'=>'ICS Calendar','x-generator'=>'Poedit 3.7','messages'=>['%1$sYou are running ICS Calendar in a WordPress Playground implementation.%2$s Because ICS Calendar is intended to run on a web server, some features may be unavailable or may not function properly.'=>'%1$sKoledar ICS uporabljate v implementaciji WordPress Playground.%2$s Ker je koledar ICS namenjen za delovanje na spletnem strežniku, nekatere funkcije morda ne bodo na voljo ali ne bodo delovale pravilno.','%1$sYour site is currently using a UTC offset-based timezone setting.%2$s This can produce time display errors in the %3$s plugin in locations that observe Daylight Saving Time. Please %4$schange your timezone setting%5$s to the city nearest your location, in the same timezone, for proper time display. See our %6$sdocumentation%7$s for additional information on this issue.'=>'%1$sVaše spletno mesto trenutno uporablja nastavitev časovnega pasu, ki temelji na premiku UTC %2$s, kar lahko povzroči napake pri prikazu časa v %3$s vtičniku na lokacijah, kjer se uporablja poletni čas. Za pravilen prikaz časa spremenite %4$snastavitev časovnega pasu%5$s na mesto, ki je najbližje vaši lokaciji, v istem časovnem pasu. Za dodatne informacije o tem vprašanju si ogledajte našo %6$sdokumentacijo%7$s.','Utilities'=>'Pripomočki','Settings'=>'Nastavitve','User Guide'=>'Priročnik za uporabo','Support'=>'Podpora','Upgrade to PRO!'=>'Nadgradite na PRO!','Show/hide all'=>'Prikaži/skrij vse','ICS file could not be retrieved or was empty. Please verify URL is correct, and check your php.ini configuration to verify either cURL or allow_url_fopen is available. If you are using spaces to delimit multiple URLs, you may also wish to try using the pipe character instead. Affected URL:'=>'Datoteke ICS ni bilo mogoče pridobiti ali je bila prazna. Preverite, ali je URL pravilen, in preverite konfiguracijo php.ini ter preverite, ali je na voljo cURL ali allow_url_fopen. Če za razmejitev več naslovov URL uporabljate presledke, lahko namesto tega poskusite uporabiti znak pipe. Prizadeti URL:','Hide past events'=>'Skrij pretekle dogodke','Show past events'=>'Prikaži pretekle dogodke','Contact:'=>'Kontaktna oseba:','Resources:'=>'Viri:','Click for more...'=>'Kliknite za več...','Save to your calendar'=>'Shranite v koledar','Cancelled'=>'Preklicano','The legacy parser option is deprecated and will be removed in a future update.'=>'Možnost starih analizatorjev je zastarela in bo odstranjena v eni od prihodnjih posodobitev.','The "currentweek" shortcode attribute is deprecated. Please use view="week" in your shortcode instead.'=>'Atribut bližnjice "currentweek" je zastarel. Namesto tega za bližnjico uporabite view="week".','The "legendinline" shortcode attribute is deprecated. Please use legendstyle="inline" in your shortcode instead.'=>'Atribut bližnjice "legendinline" je zastarel. Namesto tega za bližnjico uporabite legendstyle="inline".','Cleared %1$s %2$s transient(s).'=>'Izbrisano %1$s %2$s prehodno(-e) stanje(-a).','No %1$s transients were found.'=>'Prehodnih pojavov %1$s ni bilo ugotovljenih.','Your feed URL appears to contain HTTP Basic Authentication credentials. Try turning off the %1$s option under the %2$s tab above.'=>'Zdi se, da URL vašega vira vsebuje poverilnice za osnovno preverjanje pristnosti HTTP. Poskusite izklopiti možnost %1$s v zgornjem zavihku %2$s.','Use legacy feed request method'=>'Uporaba starejšega načina zahtevka za dovod','%1$sThis URL points to a file in your Media Library.%2$s While you should be able to use this URL in an %3$s shortcode, it will be a static snapshot of the calendar at the time the file was created, and will not reflect any future updates to the source calendar. Please see our %4$sUser Guide%5$s for instructions on obtaining your correct dynamic feed URL.'=>'%1$sTa naslov URL kaže na datoteko v vaši knjižnici medijev %2$s Čeprav bi morali biti sposobni uporabiti ta naslov URL v %3$s kratki kodi, bo to statični posnetek koledarja v času, ko je bila datoteka ustvarjena, in ne bo odražal nobenih prihodnjih posodobitev izvornega koledarja. Za navodila za pridobitev pravilnega naslova URL dinamičnega vira glejte naš %4$sUporabniški priročnik %5$s.','Error: Could not resolve IP address for %1$s.'=>'Napaka: %1$s ni bilo mogoče razrešiti IP-naslova.','Resolved IP address for %1$s:'=>'Rešen naslov IP za %1$s:','The text entered in the "Default shortcode" field is not a valid shortcode, and was not saved.'=>'Besedilo, vneseno v polje "Privzeta kratka koda", ni veljavna kratka koda in ni bilo shranjeno.','%1$sSettings updated.%2$s You may need to refresh the page to see some changes.'=>'%1$sNastavitve so posodobljene.%2$s Morda boste morali osvežiti stran, da boste videli nekatere spremembe.','calendar event'=>'dogodek koledarja','The legacy feed request method is deprecated, and will be removed in an update in the near future. Please test your feeds with the legacy feed request method turned off.'=>'Starejša metoda zahtevka za dovod je zastarela in bo odstranjena s posodobitvijo v bližnji prihodnosti. Preizkusite svoje vire z izklopljeno starejšo metodo zahtevka za vire.','Map'=>'Zemljevid','Recurring event'=>'Ponavljajoči se dogodek','Recurs every %1$s years'=>'Ponovi se na %1$s let','Recurs yearly'=>'Ponavlja se vsako leto','Recurs every %1$s months'=>'Ponovi se vsakih %1$s mesecev','Recurs monthly'=>'Ponavlja se mesečno','Recurs every %1$s weeks'=>'Ponovi se vsakih %1$s tednov','Recurs weekly'=>'Ponavlja se tedensko','Recurs every %1$s days'=>'Ponovi se vsakih %1$s dni','Recurs daily'=>'Ponavlja se vsak dan','The "url" property in your %1$s shortcode appears to contain HTML tags; most likely your URL has been turned into a clickable link. Your calendar may not display properly as a result. Please remove the clickable link in the shortcode.'=>'Zdi se, da lastnost "url" v kratki kodi %1$s vsebuje oznake HTML; najverjetneje je bil vaš naslov URL spremenjen v povezavo, na katero je mogoče klikniti. Zaradi tega vaš koledar morda ne bo pravilno prikazan. Odstranite povezavo, na katero je mogoče klikniti, iz kratke kode.','The r34ics_url_get_contents() function is no longer supported.'=>'Funkcija r34ics_url_get_contents() ni več podprta.','%1$sPlease note:%2$s %3$s version 10.6 changes the default options for several shortcode settings. In order to maintain consistency, these new defaults are %4$snot%5$s enabled when upgrading from an earlier version. If you would like to learn more about the changes please read our %6$sblog post%7$s, or to switch to the new defaults, turn on the %8$s option on the %9$s settings%10$s page.'=>'%1$sProsimo, upoštevajte:%2$s %3$s različica 10.6 spreminja privzete možnosti za več nastavitev bližnjice. Da bi ohranili doslednost, te nove privzete nastavitve niso %4$somogočene %5$s pri nadgradnji s prejšnje različice. Če želite izvedeti več o spremembah, preberite naš %6$sprispevek na blogu%7$s, če pa želite preklopiti na nove privzete nastavitve, vklopite možnost %8$s na strani %9$s z nastavitvami%10$s.','Use new parameter defaults (v.10.6)'=>'Uporaba novih privzetih vrednosti parametrov (v.10.6)','%1$sPlease note:%2$s %3$s version 11.0 streamlines the way ICS feed URLs are retrieved. This change uses a standard built-in WordPress function, so it should be fully compatible with all existing installations. If you encounter any new issues after upgrading to version 11 or later, please visit the %4$sWordPress Support Forums%5$s for assistance.'=>'%1$sUpoštevajte: %2$s %3$s različica 11.0 poenostavlja način pridobivanja naslovov URL za dovod ICS. Ta sprememba uporablja standardno vgrajeno funkcijo WordPressa, zato bi morala biti popolnoma združljiva z vsemi obstoječimi namestitvami. Če po nadgradnji na različico 11 ali novejšo različico naletite na nove težave, za pomoč obiščite %4$sforume podpore za WordPress%5$s.','%1$sPlease note:%2$s %3$s version 11.5.14.2 introduces a new, more secure method for handling calendar parameters when loading via AJAX. Please clear any caching plugins you are using, to ensure that your calendars are loading properly with the new method.'=>'%1$sUpoštevajte:%2$s %3$s različica 11.5.14.2 uvaja novo, varnejšo metodo za ravnanje s koledarskimi parametri pri nalaganju prek AJAX-a. Počistite vse vtičnike za predpomnjenje, ki jih uporabljate, da zagotovite pravilno nalaganje koledarjev z novo metodo.','Add %1$s'=>'Dodaj %1$s','Close'=>'Zapri','ICS Feed URL:'=>'URL naslov ICS:','Be sure you are using a %1$ssubscribe%2$s URL, not a %3$sweb view%4$s URL.%5$s (Entering the URL directly in your web browser should download an %6$s file.)'=>'Prepričajte se, da uporabljate %1$snaročniški%2$s URL in ne %3$sspletni%4$s pogled%5$s URL (če URL vnesete neposredno v spletni brskalnik, boste prenesli %6$s datoteko.)','Calendar Title:'=>'Naslov koledarja:','Leave empty to use calendar&rsquo;s default title. Enter %1$s to omit title altogether.'=>'Pustite prazno, če želite uporabiti privzeti naslov koledarja. Vnesite %1$s, če želite v celoti izpustiti naslov.','Calendar Description:'=>'Opis koledarja:','Leave empty to use calendar&rsquo;s default description. Enter %1$s to omit description altogether.'=>'Pustite prazno, če želite uporabiti privzeti opis koledarja. Vnesite %1$s, če želite povsem izpustiti opis.','View:'=>'Pogled:','month'=>'mesec','list'=>'seznam','week'=>'teden','Count:'=>'Število:','Format:'=>'Format:','Leave %1$s blank to include all upcoming events. %2$s must be a standard %3$sPHP date format string%4$s.'=>'Pustite %1$s prazno, če želite vključiti vse prihajajoče dogodke. %2$s mora biti standardni niz %3$sPHP v obliki datuma %4$s.','Show event descriptions %1$s(change to a number in inserted shortcode to set word limit)%2$s'=>'Prikaži opise dogodkov %1$s (spremenite v številko v vstavljeni kratki kodi, da nastavite omejitev besed) %2$s','Show event locations %1$s(if available)%2$s'=>'Prikaži lokacije dogodkov %1$s(če je na voljo)%2$s','Show event organizers %1$s(if available)%2$s'=>'Prikaži organizatorje dogodka %1$s(če je na voljo)%2$s','%1$sNote:%2$s Additional %3$sdisplay options%4$s are available by manually editing the shortcode after insertion.'=>'%1$sOpomba:%2$s Dodatne %3$smožnosti prikaza%4$s so na voljo z ročnim urejanjem kratke kode po vstavitvi.','Insert %1$s'=>'Vstavi %1$s','Do even more with %1$s!'=>'S funkcijo %1$s naredite še več!','Calendar Builder'=>'Graditelj koledarja','Configure all calendar settings with an easy visual interface... no need to manually type shortcodes.'=>'Konfigurirajte vse nastavitve koledarja z enostavnim vizualnim vmesnikom... ni potrebe po ročnem vnosu kratkih kod.','Additional Views and Enhanced Features'=>'Dodatni pogledi in izboljšane funkcije','New ways to display your calendar including Full, Up Next, Masonry, Month with Sidebar, Widget, and more. Additional capabilities are added to the core Month, Basic, List and Week views.'=>'Novi načini prikaza koledarja, vključno s polnim, naslednjim, zidanim, mesecem s stransko vrstico, pripomočkom in drugimi. Osnovnim pogledom Month, Basic, List in Week so dodane dodatne možnosti.','Customizer'=>'Prilagojevalnik','Easily modify your calendar color palettes, fonts, and more, site-wide.'=>'Enostavno spreminjajte barvne palete koledarja, pisave in še več na celotnem spletnem mestu.','ICS Events'=>'Dogodki ICS','%1$sNew!%2$s Turns %3$s into a full calendar system. Create and manage events directly in WordPress and even integrate them seamlessly with your existing feeds.'=>'%1$sNovo!%2$s Spremeni %3$s v popoln koledarski sistem. Ustvarjajte in upravljajte dogodke neposredno v WordPressu in jih celo brezhibno vključite v obstoječe vire.','Visit %1$s to learn more.'=>'Če želite izvedeti več, obiščite %1$s.','Go PRO!'=>'Go PRO!','Getting Started'=>'Začetek','System Report'=>'Sistemsko poročilo','Save Changes'=>'Shrani spremembe','Thank you for installing %1$s. Before creating your first calendar shortcode, please visit your %2$sGeneral Settings%3$s page and verify that your site language, timezone and date/time format settings are correct. See our %4$sUser Guide%5$s for more information.'=>'Hvala za namestitev %1$s. Preden ustvarite svojo prvo koledarsko bližnjico, obiščite stran %2$sSplošne nastavitve%3$s in preverite, ali so nastavitve jezika spletnega mesta, časovnega pasu in oblike datuma/časa pravilne. Za več informacij si oglejte naš %4$sUporabniški priročnik%5$s.','Quick Start Guide'=>'Kratek priročnik za začetek uporabe','An extensive %1$sUser Guide%2$s is available on our website. Below are some quick links to key resources in the documentation.'=>'Na našem spletnem mestu je na voljo obsežen %1$suporabniški priročnik%2$s. Spodaj je nekaj hitrih povezav do ključnih virov v dokumentaciji.','General:'=>'Splošno:','General WordPress Settings'=>'Splošne nastavitve WordPressa','%1$s Settings'=>'%1$s nastavitve','Working with Shortcodes:'=>'Delo s kratkimi kodami:','Shortcode Overview'=>'Pregled kratkih kod','Shortcode Builder'=>'Graditelj kratkih kod','Shortcode Parameters Reference'=>'Sklic na parametre kratke kode','Advanced Topics:'=>'Napredne teme:','FAQs and Tips'=>'Pogosta vprašanja in nasveti','CSS Guide'=>'Vodnik CSS','Developer Resources'=>'Viri za razvijalce','GDPR'=>'GDPR','Appearance'=>'Izgled','Match calendar color palette to current Block Theme colors'=>'Ujemanje barvne palete koledarja s trenutnimi barvami teme bloka','beta'=>'beta','Replaces the %1$s default neutral color palette with nearest matches from the current Site Editor Styles color palette or the %2$s file in your theme. Color selections are algorithmic, and some combinations may not pass accessibility contrast tests. This setting has no effect if you are using a "classic" theme that does not include a %3$s file.'=>'Zamenja privzeto nevtralno barvno paleto %1$s z najbližjim ujemanjem iz trenutne barvne palete slogov urejevalnika strani ali datoteke %2$s v vaši temi. Izbira barv je algoritmična in nekatere kombinacije morda ne bodo prestale testov kontrasta dostopnosti. Ta nastavitev nima učinka, če uporabljate "klasično" temo, ki ne vključuje datoteke %3$s.','%1$sThis is currently a beta feature.%2$s It may require making some adjustments to your calendar settings or CSS for optimal display, especially if you have color-coded your feeds. Functionality is subject to change.'=>'%1$sTo je trenutno funkcija beta %2$s Morda bo treba prilagoditi nastavitve koledarja ali CSS za optimalen prikaz, zlasti če ste barvno označili svoje vire. Funkcionalnost se lahko spremeni.','Dark mode'=>'Temna tema','Inverts color palette (light colors on a dark background). %1$sNote:%2$s Dark mode also automatically applies style changes similar to the %3$s and %4$s shortcode parameters, so you do not need to include them in your shortcode.'=>'Invertira barvno paleto (svetle barve na temnem ozadju). %1$sOpomba:%2$s Temni način samodejno uporabi tudi spremembe slogov, podobne parametrom %3$s in %4$s kratke kode, zato vam jih ni treba vključiti v svojo kratko kodo.','Loading'=>'Nalaganje','Always use AJAX to render calendars (recommended)'=>'Za prikazovanje koledarjev vedno uporabljajte AJAX (priporočljivo)','When checked, all calendars will render via AJAX (asynchronously after the page loads). This is especially useful in conjunction with other caching plugins, or if your calendars contain a large number of events. Normally, calendar data is sent directly in the HTML of the initial page load unless AJAX has been specified in the shortcode.'=>'Če je ta možnost označena, se vsi koledarji prikažejo prek AJAX-a (asinhrono po nalaganju strani). To je še posebej uporabno v povezavi z drugimi vtičniki za predpomnjenje ali če koledarji vsebujejo veliko število dogodkov. Običajno se koledarski podatki pošljejo neposredno v HTML ob začetnem nalaganju strani, razen če je v kratki kodi določen AJAX.','Increase memory limit when rendering calendars'=>'Povečanje omejitve pomnilnika pri upodabljanju koledarjev','If your calendar is failing to load with an "out of memory" fatal error, try increasing the memory limit. A minimum of 512 MB is recommended. %1$s Notes: 1) Some hosting providers may not allow applications to override the server default setting. 2) It is not possible to set this option lower than the current default memory limit on your server.'=>'Če se koledar ne naloži z usodno napako "zmanjkuje pomnilnika", poskusite povečati omejitev pomnilnika. Priporoča se najmanj 512 MB. %1$s Opombe: 1) Nekateri ponudniki gostovanja morda ne bodo dovolili, da aplikacije razveljavijo privzeto nastavitev strežnika. 2) Te možnosti ni mogoče nastaviti nižje od trenutne privzete omejitve pomnilnika v strežniku.','deprecated'=>'zastarelo','If your site has stopped retrieving feeds after the version 11 update, turn on this option to use the legacy request method. This feature is deprecated and will be removed in an update in the near future.'=>'Če je vaše spletno mesto po posodobitvi različice 11 prenehalo pridobivati vire, vklopite to možnost, da uporabite starejšo metodo zahtevka. Ta funkcija je zastarela in bo odstranjena v posodobitvi v bližnji prihodnosti.','Default shortcode'=>'Privzeta kratka koda','If your site will include a large number of similarly configured calendar shortcodes, you can enter a default "base" shortcode here with the parameters that should be the same for all of the calendars. Individual shortcodes on the site can then include only the parameters that are unique to that calendar, as such: %1$s Any parameters included in the individual shortcode will override what is set here.'=>'Če bo vaše spletno mesto vključevalo veliko število podobno konfiguriranih kratkih kod koledarjev, lahko tukaj vnesete privzeto "osnovno" kratko kodo s parametri, ki morajo biti enaki za vse koledarje. Posamezne bližnjice na spletnem mestu lahko nato vključujejo samo parametre, ki so edinstveni za ta koledar kot tak: %1$s Vsi parametri, vključeni v posamezno kratko kodo, bodo preglasili tukaj nastavljene parametre.','Allow access to these hostnames that resolve to reserved IP addresses'=>'Dovolite dostop do teh gostiteljskih imen, ki se nanašajo na rezervirane naslove IP','If your calendar server is hosted on the same physical server as your website, is part of the same local network, or otherwise uses a %1$sreserved IP address%2$s, enter its hostname here to allow access. For multiple calendar servers, enter one hostname per line. See %3$sthe %4$s documentation%5$s for more information.'=>'Če koledarski strežnik gostuje v istem fizičnem strežniku kot vaše spletno mesto, je del istega lokalnega omrežja ali kako drugače uporablja %1$srezerviran naslov IP%2$s, tukaj vnesite njegovo ime gostitelja, da omogočite dostop. Za več koledarskih strežnikov vnesite eno ime gostitelja v vsako vrstico. Za več informacij glejte %3$sdokumentacijo %4$s%5$s.','Enter one hostname per line. Hostnames are the base domain name, not a full URL. %1$s For example, you would enter %2$s, not %3$s.'=>'V vsako vrstico vnesite eno gostiteljsko ime. Gostiteljska imena so osnovno ime domene in ne celoten URL. %1$s Na primer, vnesite %2$s in ne %3$s.','Caching'=>'Predpolnjenje','Transient (cache) expiration'=>'Prehodni (predpomnilnik) iztek veljavnosti','seconds'=>'sekunde','Sets how long calendar feed data should be cached on the server (WordPress transients) before reloading. Default is 3600 (1 hour).'=>'Določa, kako dolgo naj se podatki koledarskega traku pred ponovnim nalaganjem shranjujejo v predpomnilniku strežnika (prehodni pojavi v WordPressu). Privzeta vrednost je 3600 (1 ura).','Miscellaneous'=>'Razno','Remove "Add ICS Calendar" button in Classic Editor'=>'Odstranitev gumba "Dodaj koledar ICS" v klasičnem urejevalniku','By default, ICS Calendar adds an "Add ICS Calendar" button to the toolbar above the WYSIWYG editor when using Classic Editor. Check this box to remove the button. Has no effect on sites using the Block Editor (Gutenberg).'=>'Koledar ICS privzeto doda gumb "Dodaj koledar ICS" v orodno vrstico nad urejevalnikom WYSIWYG, ko uporabljate klasični urejevalnik. Označite to polje, če želite gumb odstraniti. Ne vpliva na spletna mesta, ki uporabljajo urejevalnik blokov (Gutenberg).','%1$s version 10.6 introduced new default values for several shortcode parameters. New installations automatically use the new default values, but upgraded installations will continue to use the old default values, unless this box is checked. Read more about these changes on %2$sour blog%3$s.'=>'%1$s različica 10.6 je uvedla nove privzete vrednosti za več parametrov kratke kode. Nove namestitve samodejno uporabijo nove privzete vrednosti, nadgrajene namestitve pa bodo še naprej uporabljale stare privzete vrednosti, razen če je to polje označeno. Več o teh spremembah si lahko preberete na %2$snašem blogu%3$s.','Our complete user guide is available with full translation into dozens of languages on our website:'=>'Na našem spletnem mestu je na voljo celoten uporabniški priročnik s popolnim prevodom v več deset jezikov:','For assistance, please use our %1$ssupport request form%2$s.'=>'Če želite pomoč, uporabite naš %1$sobrazec za zahtevo za podporo%2$s.','When contacting support, please include the %1$sSystem Report%2$s from this page.'=>'Ko se obrnete na podporo, vključite %1$sSistemsko poročilo%2$s s te strani.','Spread the word!'=>'Razširi besedo!','If you find %1$s useful, you can help support our continued growth and development with a %2$sfive-star review%3$s. Thank you!'=>'Če se vam zdi %1$s koristno, lahko našo nadaljnjo rast in razvoj podprete z oceno %2$ss petimi zvezdicami%3$s. Hvala!','%1$s Data Cache'=>'%1$s Podatkovni predpomnilnik','Clear Cached Calendar Data'=>'Izbriši podatke koledarja v predpomnilniku','This will immediately clear all existing cached calendar data (purge transients), forcing WordPress to reload all calendars the next time they are viewed. Caching will then resume as before.'=>'To bo takoj izbrisalo vse obstoječe podatke koledarja v predpomnilniku (odstranilo prehodne pojave), zato bo WordPress ob naslednjem ogledu ponovno naložil vse koledarje. Predpomnjenje se bo nato nadaljevalo kot prej.','ICS Feed URL Tester'=>'ICS Feed URL Tester','If you are concerned that the plugin is not properly retrieving your feed, you can test the URL here.'=>'Če vas skrbi, da vtičnik ne pridobi pravilno vašega vira, lahko URL preizkusite tukaj.','Enter feed URL...'=>'Vnesite URL naslov vira...','Test URL'=>'Preskusni naslov URL','Results:'=>'Rezultati:','%1$s received.'=>'%1$s prejeto.','This appears to be a valid ICS feed URL.'=>'Zdi se, da je to veljaven URL za dovod ICS.','This does not appear to be a valid ICS feed URL.'=>'Zdi se, da to ni veljaven URL za naslov ICS.','Could not retrieve data from the requested URL.'=>'Ni bilo mogoče pridobiti podatkov iz zahtevanega naslova URL.','An unknown error occurred while attempting to retrieve the requested URL.'=>'Pri poskusu priklica zahtevanega naslova URL je prišlo do neznane napake.','Please copy the following text and include it in your message when emailing support.'=>'Ko pošljete e-pošto podpori, kopirajte naslednje besedilo in ga vključite v sporočilo.','Also please include the %1$s shortcode exactly as you have it entered on the affected page.'=>'Prav tako prosimo, da vključite %1$s bližnjico točno tako, kot ste jo vnesli na prizadeto stran.','For your site security please do NOT post the System Report in the support forums.'=>'Zaradi varnosti vašega spletnega mesta NE objavljajte sistemskega poročila na forumih za podporo.','No events found.'=>'Ni bilo najdenih dogodkov.','Previous Page'=>'Prejšnja stran','Next Page'=>'Naslednja stran','All Day'=>'Cel dan','Today'=>'Danes','No events.'=>'Brez dogodkov.','No additional events this month.'=>'Ta mesec ni dodatnih dogodkov.','Last week'=>'Prejšnji teden','This week'=>'Ta teden','Next week'=>'Naslednji teden','ICS Calendar'=>'Koledar ICS','https://icscalendar.com'=>'https://icscalendar.com','Turn your Google Calendar, Microsoft Office 365 or Apple iCloud Calendar into a seamlessly integrated, auto-updating, zero-maintenance WordPress experience.'=>'Koledar Google Calendar, Microsoft Office 365 ali Apple iCloud Calendar spremenite v brezhibno integrirano, samodejno posodabljajočo se izkušnjo WordPressa brez vzdrževanja.','Room 34 Creative Services, LLC'=>'Soba 34 Kreativne storitve, LLC']];
